import "../App.css";
import React, { useState, useEffect } from "react";
import Table from "react-bootstrap/Table";

const ShowActiveSession = () => {
  const [data, setData] = useState([]);
  try {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/getActiveSession`)
      .then((response) => {
        setData({
          sessionId: data.emailAddress,
          sessionRequestedBy: data.firstName,
          statusCode: data.statusCode,
          message: data.message,
        });
        console.log(response);
        console.log(response.data);
      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error";
  }

  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Session Id</th>
          <th>Session Requested By</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.sessionId}>
            <td>{data.sessionId}</td>
            <td>{data.sessionRequestedBy}</td>
          </tr>
        }
      </tbody>
    </Table>
  );

  if (data.statusCode == 200) {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Session Id</th>
            <th>Session Requested By</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.sessionId}>
              <td>{data.sessionId}</td>
              <td>{data.sessionRequestedBy}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  } else {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Message</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.message}>
              <td>{data.message}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  }
};
export default ShowActiveSession;
